import React from "react";
import "./Signup.css";

function Signup() {
    return (
        <div>
            <div>
                <img src={path} alt="" className="path" />
                <div className="logo">
                    <img src={deski_white} alt="" height="80" width="120" />
                </div>
            </div>
        </div>
    );
}

export default Signup;
